import React from 'react'
// import './home.css'
import {
    MDBBtn,
    MDBNavbarLink
  } from 'mdb-react-ui-kit';
import Header from '../../components/header/header';
const Home = () => {
    return (
        <div>
              <Header></Header>
            {/* <h1 style={{padding:500}}>This is the homepage</h1> */}
            <div>
                <h2>Featured Services</h2>
                <MDBNavbarLink >
              <MDBBtn
                outline rounded className='mx-2' color='dark'
                href='services'
              >
                All Services
              </MDBBtn>
              </MDBNavbarLink>
            </div>
        </div>
    )
}

export default Home;
